Europe's Revolutions: 25 Years on

Sociopolitical Documentary hosted by Tanya Beckett, published by BBC broadcasted as part of BBC Our World series in 2014 - English narration


Information
------------------------------

It's a quarter of a century since revolutions swept across Eastern Europe tearing down the Iron Curtain. The Soviet Union's grip on the 'Eastern Block' countries ended and fledgling democracies were born. For Our World Tanya Beckett has travelled across the region to meet some of the architects of the revolutions, and people whose lives were changed forever by the events of 1989.

